import React, {Component} from "react"

class LinkCard extends Component{

    render() {
        return(
            <div className="cardContainer" style={style.cardContainer}>
                Hello
            </div>
        );
    }

}

const style = {
    cardContainer: {
        border: "1 solid",
        position: "relative",
        float: "right",
        width: "100%",
        height: "20%"
    }
}

export default LinkCard;
